@import './normalize.css';

html{
    font-size: 62.5%;
    scroll-behavior: smooth;
}

:root{
    --color-primary:#fff;
    --color-secondary:#262622;
    --color-accent:#BF6341;
    --color-brown:#BF8F54;
} 

*,
*::after,
*::before {
  box-sizing: border-box;
}

a{
    text-decoration: none;
    color:var(--color-secondary);
}

.container{
    max-width:1440px;
    margin:0 auto;
}

body{
    font-family: 'Open Sans', Arial, Helvetica, sans-serif;
    color:#fff;
    font-size:1.563rem;
    line-height:1.5;
    font-weight: 300;
}

h1,
h2,
h3{
    font-family: 'Roboto', Arial, Helvetica, sans-serif;
    margin-bottom: 1rem;
}

h4{
    font-family: 'Open Sans', Arial, Helvetica, sans-serif;
    font-weight: 300;
}

h1{
    color:#fff;
}

h2,h3,h4{
    color:var(--color-secondary);
}

h1{
    font-size: 3.052rem;
}
h2{
    font-size:3rem;
    letter-spacing: 0.1rem;
}
h3{
    font-size:2.5rem;
}

h4{
    font-size:1.8rem;
    line-height: 1.4;
}

.lead{
    font-size: 1.563rem;
}

.lead-second{
    font-size:1.2rem;
    white-space: nowrap;
    text-align: center;
    margin:2rem auto;
}

.strong{
    font-weight: 700;
}

.bold{
    font-weight: 400;
}

.secondary{
    color:var(--color-secondary);
}

.primary{
    color:var(--color-primary);
}

.accent{
    color:var(--color-accent);
}


@media screen and (min-width:600px){
    body{
        font-size:2rem;
    }
    h1{
        font-size:6rem;
    }
    h2{
        font-size:3.998rem;
    }
    h3{
        font-size:2.827rem;
    }
    h4{
        font-size:2.6rem;
    }

    .lead{
        font-size: 2rem;
    }
    .lead-second{
        font-size:1.8rem;
        letter-spacing: 1px;
    }
}



@media screen and (min-width:768px){

    h1{
        font-size:7rem;
    }
}

@media screen and (min-width:1024px){
    body{
        font-size:2rem;
    }
    h1{
        font-size:10rem;
    }
    h2{
        font-size:4.5rem;
    }
    h3{
        font-size:3.375rem;
    }
    h4{
        font-size:2.4rem;
        line-height: 2;
    }
    .lead{
        font-size: 2.2rem;
    }
    .lead-second{
        font-size:2rem;
        letter-spacing: 2px;
    }
}

/* background image */
.cover-image{
   background: url(../images/hero-small.webp) no-repeat;
   background-size: cover;
   min-width:100%; 
   min-height:100vh;
   background-position: center center;

}

.no-webp .cover-image{
    background: url(../images/hero-small.jpg) no-repeat;
   background-size: cover; 
}

@media
only screen and (-webkit-min-device-pixel-ratio: 2)      and (min-width: 320px),
only screen and (   min--moz-device-pixel-ratio: 2)      and (min-width: 320px),
only screen and (     -o-min-device-pixel-ratio: 2/1)    and (min-width: 320px),
only screen and (        min-device-pixel-ratio: 2)      and (min-width: 320px),
only screen and (                min-resolution: 192dpi) and (min-width: 320px),
only screen and (                min-resolution: 2dppx)  and (min-width: 320px) { 

    .cover-image{
        background: url(../images/hero-small@2x.webp) no-repeat;
        background-size: cover;
     }

     .no-webp .cover-image{
         background: url(../images/hero-small@2x.jpg) no-repeat;
        background-size: cover; 
     }

}

@media screen and (min-width:768px){
    .cover-image{
        background: url(../images/hero-medium.webp) no-repeat;
        background-size: cover;
    }
    .no-webp .cover-image{
        background: url(../images/hero-medium.jpg) no-repeat;
       background-size: cover; 
    }
}

  @media
  only screen and (-webkit-min-device-pixel-ratio: 2)      and (min-width: 600px),
  only screen and (   min--moz-device-pixel-ratio: 2)      and (min-width: 600px),
  only screen and (     -o-min-device-pixel-ratio: 2/1)    and (min-width: 600px),
  only screen and (        min-device-pixel-ratio: 2)      and (min-width: 600px),
  only screen and (                min-resolution: 192dpi) and (min-width: 600px),
  only screen and (                min-resolution: 2dppx)  and (min-width: 600px) { 
    .cover-image{
        background: url(../images/hero-medium@2x.webp) no-repeat;
        background-size: cover;
    }
    .no-webp .cover-image{
        background: url(../images/hero-medium@2x.jpg) no-repeat;
       background-size: cover; 
    }


  }

@media screen and (min-width:1024px){
    .cover-image{
        background: url(../images/hero-large.webp) no-repeat;
        background-size: cover;
    }
    .no-webp .cover-image{
        background: url(../images/hero-large.jpg) no-repeat;
       background-size: cover; 
    }
}

@media
only screen and (-webkit-min-device-pixel-ratio: 2)      and (min-width: 1300px),
only screen and (   min--moz-device-pixel-ratio: 2)      and (min-width: 1300px),
only screen and (     -o-min-device-pixel-ratio: 2/1)    and (min-width: 1300px),
only screen and (        min-device-pixel-ratio: 2)      and (min-width: 1300px),
only screen and (                min-resolution: 192dpi) and (min-width: 1300px),
only screen and (                min-resolution: 2dppx)  and (min-width: 1300px) { 
    .cover-image{
        background: url(../images/hero-large@2x.webp) no-repeat;
        background-size: cover;
    }
    .no-webp .cover-image{
        background: url(../images/hero-large@2x.jpg) no-repeat;
       background-size: cover; 
    }


}

/* back-to-top */

#back-to-top{
    cursor: pointer;
    color:#26262283;
    position: fixed;
    bottom:3rem;
    right:3rem;
    font-size:2rem;
    border: 2px solid #26262283;
    padding:0.5rem 1rem;
background-color: white;
outline:0;
z-index: 1000;
transition: 0.3s;
}

#back-to-top:hover{
    background-color:var(--color-accent);
    color:white;
    border: 2px solid white;
}

@media  screen and (min-width:768px) {
#back-to-top{    
    font-size:3rem;
    padding:0.5rem 1.5rem;
    border: 3px solid #26262283;
}
}

/* block */

.block{
    --padding-vertical:6rem;
    padding:var(--padding-vertical) 2rem;
}

.block__header{
    text-align: center;

}

.block__footer{
    padding-bottom:10rem;
}

/* margin */

.margin--block{
    margin:0 2rem;
  }

.margin-bottom--small{
    margin-bottom:1.5rem;
}

/* padding */
.padding-top--block{
    padding-top: 3rem;
}

/* text-align */

.text-align--left{
  text-align:left;
}  

@media screen and (min-width:768px) {
   .text-align-tablet--left{
    text-align:left;
}  
}

/* hero */

.hero__heading{
    text-transform: uppercase;   
}

.hero-block{
    padding:2rem 2rem 6rem;
}


@media screen and (min-width:375px){
    .hero-block{
        padding:10rem 2rem 10rem;
}
}

@media screen and (min-width:1024px){
    .hero-block{
        padding:15rem 2rem;
}
}

@media screen and (min-width:1300px){
    .hero-block{
        padding:0 2rem 6rem;
}
}



/* button */

.btn{
    padding:1rem 4rem;
    outline:none;
    border:0.1px solid #fff;
    background-color: transparent;
    cursor:pointer;
    white-space:nowrap;
    text-align: center;
    margin:1rem 0;
    color:#fff;
    text-transform: uppercase;
    font-size: 1.2rem;
}


.btn:hover{
    background-color:#f2eeeb7a ;
}

@media screen and (min-width:600px){
    .btn{
        font-size:1.8rem;
        letter-spacing: 2px; 
    }
}

@media screen and (min-width:768px){
    .btn{
        font-size:2rem;
        letter-spacing: 2px; 
    }
}

@media screen and (min-width:1024px){
    .btn{
        font-size:2.5rem;
    }
}

/* icon */

.icon{
    width:40px;
    height:40px;
}

.icon--secondary{
    fill:var(--color-secondary);
}

.icon--white{
    fill:#fff;
}

.icon--pin{
    margin:0 0.4rem 0 0.4rem;
}

.icon--fee{
 font-size:3rem;
padding-bottom:0.5rem;
}

.icon--fas{
    background-color: var(--color-accent);
}

/* callopsible */
.collapsible__header{
    display:flex;
    justify-content: space-between;
    align-items: flex-start;
    border-bottom:0.5px solid #fff;
    margin-bottom: 1rem;
}

.collapsible__heading{
    margin-top:0;
}

.collapsible__chevron{
    transform: rotate(-90deg);
    transition:transform 0.3s;
}

.collapsible__content{
    max-height:0;
    overflow: hidden;
    opacity:0;
    transition:all 0.3s;
}

.collapsible--expanded .collapsible__chevron{
    transform: rotate(0);
}

.collapsible--expanded .collapsible__content{
    max-height:100vh;
    opacity:1;
}

/* list */

.list{
    list-style: none;
    padding-left:0;
}

@media screen and (min-width:768px){
    .list__tablet{
        list-style: outside;
    }
}

.list__content{
    margin-top:0;
    padding-left:0;
}

/* nav */

.nav__brand{
    padding-top: 0.5rem;
    padding-left:1rem;
}
.nav__logo{
    width:4rem;
    height:4rem;
}

.nav{
    display:flex;
    justify-content: space-between;
    flex-wrap:wrap;

    align-items: center;
font-weight: 400; 
    text-transform: uppercase;
align-items:center;
width:100vw;
background-color: #f2eeeb37;
}



.nav__list{
    width:100%;
    margin:0;
}

.nav__item{
    padding:1.5rem 2rem;
    border-bottom: 0.2px solid var(--color-primary);

}

.nav__item>a{
    color:#262622;
}

.nav__item:hover>a{
    color:var(--color-primary);
    transition:color 0.3s;
}

.nav__item:hover{
    background-color: var(--color-accent);
}

.nav__toggler{
    opacity:1;
    cursor:pointer;
  position:absolute;
  top:2px;
  right:0;
  margin:0.6rem 0.8rem 0 ;
fill:var(--color-accent); 
  transition:all 0.15s;
}

.nav__toggler__close{
    opacity:0;
   width: 25px;
   margin:1rem 1.6rem 0 ;
   fill:#fff;
}

.nav.collapsible--expanded .nav__toggler{
    opacity:0; 
    fill:#fff;
}
.nav.collapsible--expanded .nav__toggler__close{
    opacity:1; 
    fill:var(--color-accent);

}

@media screen and (min-width:768px){


    .nav__toggler, .nav__toggler__close{
        display:none;
    }



    .nav__list{
        max-height:100%;
        opacity: 1;
        display:flex;
        width:auto;
    }

    .nav__item:hover>a{
        color:var(--color-primary);
    }

    .nav__item:hover{
        background-color: var(--color-accent);
        transition:background-color 0.3s;
    }

    .nav-bottom-border{
        border-bottom: 0.5px solid var(--color-primary);
     }   

     .nav__item{
    border-bottom: none;
}
}




/* grid */

.grid{
    display:grid;
}

@media screen and (min-width:768px){
.grid--1x2{
    grid-template-columns: repeat(2,1fr);
}
.grid--1x3{
    grid-template-columns: repeat(3,1fr);
}
}

@media screen and (min-width:1024px){
    .grid--1x2-desktop{
        grid-template-columns: repeat(2,1fr);
    }
    .grid--1x3-desktop{
        grid-template-columns: repeat(3,1fr);
    }  
}

/* profile */

.profile--block{
    background-color: var(--color-brown); 
}

.profile__image{
    width:100%;
    margin:0 auto;
    padding:1rem;

}

.profile__content{
    padding:5rem 1rem 0 1rem;
    text-align:center;
}
.profile__content2{
    padding:0 1rem;
    text-align:center;
}

.block__heading{
    margin:0;
}

.profile--decoration{
    border-bottom:1px solid var(--color-accent);
    margin-bottom: 2.5rem;
}

.profile__p__phone-to-tablet-hide{
    display: none;
}


@media screen and (min-width:1024px){
    .profile__image{
        padding:5rem;
    } 
    .profile__content{
        padding:5rem;
        text-align:left;
    }
    .profile__content2{
    padding:0 3rem 5rem 9rem;
    }
    .profile__p__desktop-hide{
        display: none;
    }
    .profile__p__desktop-show{
        display:inline;   
    }
    .eduation--margin{
        display: flex;
        align-items: center;
        flex-direction: column;

    }

}

.profile__image{
    width:80%;
    position: relative;
    z-index: 2;   
}

/* style-wraper */

.style-container{
    position:relative;   
}

.style{
    border:1px solid var(--color-primary);
    position: absolute;
    top:20%;
    left:20%;
    z-index:1;
}

.style-wraper{
    width:70%;
    height: 0;
    padding-bottom: 70%;
}

@media screen and (min-width:768px){

    .style-wraper{
        width:72%;
        height: 0;
        padding-bottom: 72%;
    }

}


@media screen and (min-width:1024px){

    .style-wraper{
        width:65%;
        height: 0;
        padding-bottom: 65%;
    }

}

/* faq */
.faq--block{
    background-color: var(--color-accent); 
}

.faq__image{
    width:80%;
    margin:0 auto;

}

.faq__content{
    color:#fff;
    padding:2rem;
    text-align:left;
}

.faq__heading{
    margin:0;
    padding-bottom: 1.5rem;
    text-align: left;
    text-transform: uppercase;
    color:#fff;
}

.faq__item{
    padding:1rem 0;
}

.faq__item__heading{
    color:#fff;
}


.faq__image{
    width:80%;
    position: relative;
    z-index: 2;   
}



@media screen and (min-width:1024px){
    .faq__image{
        padding:5rem;
    } 
    .faq__content{
        padding:8rem 2rem;
    }
}

/* service */

.pot-image{
    background: url(../images/pot-small.webp) no-repeat;
    background-size: cover;
    width:100%; 
    min-height:100vh;
    background-position: center center;
background-attachment: fixed;
margin:0 auto;
 }

 .no-webp .pot-image{
    background: url(../images/pot-small.jpg) no-repeat;
   background-size: cover; 
   background-position: center center;
   background-attachment: fixed;
}


@media
only screen and (-webkit-min-device-pixel-ratio: 2)      and (min-width: 320px),
only screen and (   min--moz-device-pixel-ratio: 2)      and (min-width: 320px),
only screen and (     -o-min-device-pixel-ratio: 2/1)    and (min-width: 320px),
