    .pot-image{
        background: url(../images/pot-small@2x.webp) no-repeat;
        background-size: cover;
        background-position: center center;
        background-attachment: fixed;
     }

     .no-webp .pot-image{
         background: url(../images/pot-small@2x.jpg) no-repeat;
        background-size: cover; 
